import React from 'react'
import Checkout from '../pages/Checkout'
import { BsBagCheckFill } from 'react-icons/bs'

function Cart() {
  return (
    <div><p>Cart</p>

     <div className='checkout'>
    <Link to="./Checkout">{<BsBagCheckFill/>}</Link>
    </div>
    </div>

  )
}

export default Cart
